import React from 'react';
import NewsList from '../components/NewsList';
import NewsForm from '../components/NewsForm';

const Home = ({ user }) => (
  <div className="py-8">
    <h2 className="text-3xl font-bold text-neutral mb-6">Daily News</h2>
    <NewsForm user={user} />
    <NewsList user={user} />
  </div>
);

export default Home;
